INSERT IGNORE INTO `tblQuestion` (`Id`,`Competence`,`Texte`, `IdTypeQuestion`, `IdCategorieQuestion`) VALUES (3,'Sens des responsabilités','L’élève stagiaire est-il ou est-elle sérieux-se, réfléchie et endosse-t-il ou endosse-t-elle les actes qu''il ou elle pose dans l''exécution de ses tâches?',1,9);
INSERT IGNORE INTO `tblQuestion` (`Id`,`Competence`,`Texte`, `IdTypeQuestion`, `IdCategorieQuestion`) VALUES (4,'Motivation','L’élève stagiaire manifeste-t-il ou manifeste-t-elle un intérêt soutenu à l''égard de son travail?',1,9);
INSERT IGNORE INTO `tblQuestion` (`Id`,`Competence`,`Texte`, `IdTypeQuestion`, `IdCategorieQuestion`) VALUES (5,'Tenue','L’élève stagiaire adopte-t-il ou adopte-t-elle la tenue exigée par les circonstances et le milieu professionnel? ',1,9);
INSERT IGNORE INTO `tblQuestion` (`Id`,`Competence`,`Texte`, `IdTypeQuestion`, `IdCategorieQuestion`) VALUES (6,'Comportement','L’élève stagiaire adopte-t-il ou adopte-t-elle le comportement exigé par les circonstances et le milieu professionnel?',1,9);
