INSERT IGNORE INTO `tblQuestion` (`Id`,`Competence`,`Texte`, `IdTypeQuestion`, `IdCategorieQuestion`) VALUES (9,'Application','L’élève stagiaire fait-il ou fait-elle preuve d''une application constante dans son travail? ',1,10);
INSERT IGNORE INTO `tblQuestion` (`Id`,`Competence`,`Texte`, `IdTypeQuestion`, `IdCategorieQuestion`) VALUES (10,'Qualité du travail','L’élève stagiaire fournit-il ou fournit-elle un travail de qualité tant sur la  forme que sur le fond? ',1,10);
INSERT IGNORE INTO `tblQuestion` (`Id`,`Competence`,`Texte`, `IdTypeQuestion`, `IdCategorieQuestion`) VALUES (11,'Rapidité d''exécution','L’élève stagiaire exécute-t-il ou exécute-telle correctement son travail dans le temps prescrit par les normes de l''organisation pour une ou un stagiaire?',1,10);
INSERT IGNORE INTO `tblQuestion` (`Id`,`Competence`,`Texte`, `IdTypeQuestion`, `IdCategorieQuestion`) VALUES (12,'Initiative et autonomie','L’élève stagiaire prend-il ou prend-elle des initiatives pour apprendre, agir ou essayer dans le cadre du projet demandé?',1,10);
INSERT IGNORE INTO `tblQuestion` (`Id`,`Competence`,`Texte`, `IdTypeQuestion`, `IdCategorieQuestion`) VALUES (13,'Esprit de collaboration','L’élève stagiaire montre-t-il ou montre-telle l''aptitude et la volonté de travailler avec les autres?',1,10);
