INSERT IGNORE INTO `tblQuestion` (`Id`,`Competence`,`Texte`, `IdTypeQuestion`, `IdCategorieQuestion`) VALUES (16,'Capacité d''apprendre','L’élève stagiaire intègre-t-il ou intègre-telle bien la théorie et la pratique dans les travaux reliés à son projet de stage?',1,11);
